window.bookSummaryJSON = "<p>Ten thousand years ago, a single alien super-ship survived a desperate battle. The vessel's dying crew set the AI on automatic to defend the smashed rubble of their planet. Legend has it the faithful ship continues to patrol the empty battlefield, obeying its last order throughout the lonely centuries. </p> <p></p> <p>In the here and now, Earth needs a miracle. Out of the Beyond invade the New Men, stronger, faster and smarter than the old. Their superior warships and advanced technology destroy every fleet sent to stop them. Their spies have infiltrated the government and traitors plague Earth's military. </p> <p></p> <p>Captain Maddox of Star Watch Intelligence wonders if the ancient legend could be true. Would such an old starship be able to face the technology of the New Men? On the run from killers, Maddox searches for a group of talented misfits. He seeks Keith Maker, a drunken ex-strikefighter ace, Doctor Dana Rich the clone thief stuck on a prison planet and Lieutenant Valerie Noonan, the only person to have faced the New Men in battle and survived to tell about it. </p> <p></p> <p>Maddox has to find a place hidden in the Beyond and bring back a ship no one can enter. If he fails, the New Men will replace the old. If he succeeds, humanity might just have a fighting chance...</p>"; 
